import React from "react";
import {
  VictoryBar,
  VictoryChart,
  VictoryAxis,
  VictoryTheme,
  VictoryStack,
  VictoryPolarAxis,
} from "victory";

const Graph = (props) => {
  return (
    <VictoryChart polar theme={VictoryTheme.material}>
      {["cat", "dog", "bird", "dog", "frog", "fish"].map((d, i) => {
        return (
          <VictoryPolarAxis
            startAngle={0}
            endAngle={180}
            tickValues={[0, 45, 90, 135, 180]}
          />
        );
      })}
    </VictoryChart>
  );
};
export default Graph;
